import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './Dashboard.css';

const Dashboard = () => {
  const [requests, setRequests] = useState([]);
  const [filteredRequests, setFilteredRequests] = useState([]);
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(true);

  const [filterLectureName, setFilterLectureName] = useState('');
  const [filterResourcePerson, setFilterResourcePerson] = useState('');
  const [filterFacultyCoordinator, setFilterFacultyCoordinator] = useState('');
  const [filterDate, setFilterDate] = useState('');

  useEffect(() => {
    const fetchRequests = async () => {
      try {
        // Simulate fetching approved requests from the backend with a timeout
        const response = await new Promise((resolve) =>
          setTimeout(() => resolve({
            data: [
              {
                id: 1,
                lectureName: 'Advanced React',
                resourcePerson: 'John Doe',
                facultyCoordinator: 'Jane Smith',
                venue: 'Auditorium',
                date: '2024-07-01',
                attendees: 50
              },
              {
                id: 2,
                lectureName: 'Machine Learning Basics',
                resourcePerson: 'Alice Johnson',
                facultyCoordinator: 'Robert Brown',
                venue: 'Room 101',
                date: '2024-07-05',
                attendees: 70
              }
              // Add more dummy data if needed
            ]
          }), 1000)
        );
        setRequests(response.data);
        setFilteredRequests(response.data);
        setLoading(false);
      } catch (error) {
        setError('Failed to fetch requests');
        setLoading(false);
      }
    };

    fetchRequests();
  }, []);

  useEffect(() => {
    const applyFilters = () => {
      let filtered = requests;

      if (filterLectureName) {
        filtered = filtered.filter(request =>
          request.lectureName.toLowerCase().includes(filterLectureName.toLowerCase())
        );
      }

      if (filterResourcePerson) {
        filtered = filtered.filter(request =>
          request.resourcePerson.toLowerCase().includes(filterResourcePerson.toLowerCase())
        );
      }

      if (filterFacultyCoordinator) {
        filtered = filtered.filter(request =>
          request.facultyCoordinator.toLowerCase().includes(filterFacultyCoordinator.toLowerCase())
        );
      }

      if (filterDate) {
        filtered = filtered.filter(request =>
          request.date === filterDate
        );
      }

      setFilteredRequests(filtered);
    };

    applyFilters();
  }, [filterLectureName, filterResourcePerson, filterFacultyCoordinator, filterDate, requests]);

  return (
    <div className="dashboard">
      <h2>Dashboard</h2>
      {loading ? (
        <p>Loading...</p>
      ) : (
        <>
          {error && <div className="error">{error}</div>}
          <div className="filters">
            <input
              type="text"
              placeholder="Filter by Lecture Name"
              value={filterLectureName}
              onChange={(e) => setFilterLectureName(e.target.value)}
            />
            <input
              type="text"
              placeholder="Filter by Resource Person"
              value={filterResourcePerson}
              onChange={(e) => setFilterResourcePerson(e.target.value)}
            />
            <input
              type="text"
              placeholder="Filter by Faculty Coordinator"
              value={filterFacultyCoordinator}
              onChange={(e) => setFilterFacultyCoordinator(e.target.value)}
            />
            <input
              type="date"
              placeholder="Filter by Date"
              value={filterDate}
              onChange={(e) => setFilterDate(e.target.value)}
            />
          </div>
          <table className="dashboard-table">
            <thead>
              <tr>
                <th>S.No</th>
                <th>Name of Lecture</th>
                <th>Resource Person</th>
                <th>Faculty Coordinator</th>
                <th>Venue</th>
                <th>Date</th>
                <th>Attendees</th>
              </tr>
            </thead>
            <tbody>
              {filteredRequests.map((request, index) => (
                <tr key={request.id}>
                  <td>{index + 1}</td>
                  <td>{request.lectureName}</td>
                  <td>{request.resourcePerson}</td>
                  <td>{request.facultyCoordinator}</td>
                  <td>{request.venue}</td>
                  <td>{request.date}</td>
                  <td>{request.attendees}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </>
      )}
    </div>
  );
};

export default Dashboard;
